import base64
from datetime import datetime
from os import remove

import cv2


def preload_model():
    from deepface import DeepFace

    """
    Preload to avoid latency during first call
    """
    # NOTE: we will hardcode the img
    img = ""
    open("Blank.jpg", "wb").write(base64.b64decode(img))
    DeepFace.analyze("Blank.jpg", actions=["emotion"], enforce_detection=False)
    remove("Blank.jpg")


def analyze_frame(img, debug=False):
    from deepface import DeepFace

    try:
        res = DeepFace.analyze(img, actions=["emotion"])
        if debug:
            frame = cv2.imread(img)
            dominant_emotion = res[0]["dominant_emotion"]
            debug_image = cv2.putText(
                frame,
                f"EMOTION: {dominant_emotion}",
                (20, 20),
                cv2.FONT_HERSHEY_SIMPLEX,
                0.5,
                (255, 0, 0),
                1,
                cv2.LINE_AA,
            )
            cv2.imwrite(f"image_{datetime.now()}.png", debug_image)
        return res
    except Exception as e:
        if debug:
            print(f"[PYTHON]: Error during analysis\nERROR: {e}")
            cv2.imwrite(f"failed_{datetime.now()}.png", img)
        raise Exception("Failed to detect face")
